import logo from '../assets/logo.png'

function Navbar() {
  return (
   <div className='flex flex-row '>
      <img src={logo}></img>
      <p>Home</p>
      <p>Search</p>
      <p>Categories</p>
      <p>Login</p>
      <p>Register</p>
   </div>
  )
}

export default Navbar;
